import { Box, Typography } from "@mui/material"






export const Feature = ({ title, text }) => {
    const StylesForSame = {
        color: 'white',
        textTransform: 'none'
    }
    const BoxStyles={
        display:'flex',
        alignItems:'center',
        justifyContent:'spaceBetween',
        width:'100%'

    }
    return (
        <>
            <Box sx={BoxStyles}>
                <Typography
                    sx={{...StylesForSame,flexGrow:1}}
                    variant="h4"

                >
                    {title}
                </Typography>

             
                <Typography
                    sx={StylesForSame}

                    variant="body1"
                     
                >
                    {text}
                </Typography>
            </Box>
        </>
    )
}
